Apocalipsis Vampira (Eduard Cujo, Thagson / 2013)

Joe receives the newspaper containing an obituary of his dead brother that relates to a terrible discovery: the existence of a lineage of thirsty vampires of blood and sperm. LUCY and BRENDA, two irresistible possessed vampires, will utilize all of their charms to obtain new victims, and thus to satisfy their leader, the Senor of the Dark, in their orgies of sex and blood.

Renata Wife, Laura Brent, Katryna Romanova, Isha Oslov, Califa, Andrea Moranti, Hektor Garcia, Juan Carlos Bonet

Feature,All sex,Anal,Facial

